const Navbar = () => {
    return(
        <nav class="bg-red-900 relative">
          <div class="container bg-red-900 flex">
            <h1 class=" text-3xl font-extrabold m-2">ZETARIORS</h1>
              <ul class="align-center flex">
                <li class="text-white m-2"><a href="#">Home</a></li>
                <li class="text-white m-2"><a href="#">Gallery</a></li>
                <li class="text-white m-2"><a href="#">Contact</a></li>
              </ul>
          </div>
        </nav>
    )
}



export default Navbar;
